INSERT INTO `ensembles` (`id_ensemble`, `name`, `description`, `link`, `enabled`) VALUES
('B5Q', 'Brass quintet', 'A brass quintet is a five-piece musical ensemble composed of brass instruments. The instrumentation for a brass quintet typically includes two trumpets or cornets, one French horn, one trombone or euphonium/baritone horn, and one tuba or bass trombone.', '', 1),
('BK', 'Brass choir', 'A small ensemble consisting mainly of instruments in the brass family, sometimes adding percussion.', '', 1),
('C', 'Austin Civic Wind Ensemble', 'The Austin Civic Wind Ensemble is a gathering of adult musicians enjoying the challenge of a high-quality repertoire.  The wide range of age and skill level supports our value of inclusion and fosters our mission of using music for lifelong learning, while promoting joy in our community through live performances.', 'https://acwe.org/about', 1),
('CC', 'Cosmic Clarinets', 'The Cosmic Clarinets play clarinet ensembles and choirs for clarinets', '', 1),
('HC', 'ACWE Horn Choir', 'An indeterminate number of horn (Horn in F) players', '', 1),
('JB', 'Jazz band', 'Full 17-piece jazz band', '', 0),
('TC', 'ACWE Trombone Choir', 'An indeterminate-numbered-sized group of trombonists', '', 1),
('VC', 'Violet Crown Flute Choir', 'The Violet Crown Flute Choir flute ensemble does not require auditions and welcomes players of varying skill levels who desire to be part of a unique chamber group experience and celebrate the beautiful sound of the flute - including piccolo, C flute, alto flute, and bass flute. The choir plays mostly intermediate level repertoire and focuses on the fundamentals of flute playing to improve all members\' musical aptitude.', 'http://violetcrownflutechoir.org', 1),
('WB', 'Austin Wonder Brass', 'A brass group from the past, now known as Austin Brass Band', 'https://austinbrassband.com/', 1);
